import React from 'react'

const Poster = () => {
  return (
    <div>
        <div style={{fontWeight:"600",fontSize:"40px",paddingLeft:"260px",gap:"80px"}}>Airbnb it easily with Airbnb Setup</div>
        <div><img style={{width:"100%"}} src="./img/Poster.png" alt="" /></div>
        <div></div>
    </div>
  )
}

export default Poster
